- name: ACCU York [Dec 2018]
  description: "<p>Talk #1 from Andy Callaghan - Making a website performant: Part II</p> <p>The second part of Andy’s web performance talk.</p> <p>Talk #2 from Maxime Maigret - Pragmatic TDD, from design driven by the tests</p> <p>TDD is a very powerful tool to help you to use a simple design when you need to implement a requirement. It's more than just about testing, it gives a guideline to follow to avoid pitfall and to increase code maintainability and readability</p> <p>Many thanks to York Science Park (YSP) for providing us a place to meet.</p> "
